import React, { useContext, useState } from "react";
import Login from "./component/login";
import { BrowserRouter, Route, NavLink,Link, Routes } from "react-router-dom";
import Admin from "./component/admin";
import User from "./component/user";
import Signup from "./component/signup";
import Landing from "./component/landing";
import Card from "./component/card";
import AdminLogin from "./component/adminlogin";
import AdminSignup from "./component/adminsignup";
import formContext from "./context/form/formcontext";
import Contact from "./component/contact";



function App() {

  const a = useContext(formContext)

  const [num, inc] = useState(0);

  console.log('nav')

  const navLinkstyle=({isActive})=>{

    return {
      fontWeight: isActive ? 'bold':'normal',
      textDecoration: isActive ? 'none' : 'underline'
    }
  }



  return (
    <BrowserRouter>

      <nav style={{ background: 'white' }} >



        <div style={{ display: 'flex', padding: '2.5% 0', margin: '0 auto', textAlign: 'center', justifyContent: 'center' }} className="nav-btns">



          <NavLink style={navLinkstyle} to={'/'} id="nav-2"

            >Home</NavLink>


          <NavLink style={navLinkstyle} to={'/contact'} id="nav-3"

            >Contact Us</NavLink>



          }


        </div>

      </nav>

      <Routes>
        <Route path="/" element={< Landing />} />
        <Route path="/login" element={<Login />} />

        <Route path="admin" element={<Admin />} />

        <Route path="user" element={<User />} />

        <Route path="signup" element={<Signup />} />

        <Route path="adminsignup" element={<AdminSignup />} />

        <Route path="card" element={<Card />} />

        <Route path="/contact" element={<Contact />} />

        <Route path="adminlogin" element={<AdminLogin />} />
      </Routes>
    </BrowserRouter>
  )
}

export default App;
